import React, { useState } from 'react';
import axios from 'axios';
import './ImportCSV.css';

function ImportCSV() {
  const [trainData, setTrainData] = useState(null);
  const [testData, setTestData] = useState(null);
  const [graphUrl, setGraphUrl] = useState(null);
  const [graphUrl1, setGraphUrl1] = useState(null);
  const [graphRowCount, setGraphRowCount] = useState(null);
  const [graphColumnCount, setGraphColumnCount] = useState(null);
  const [graphTarget, setGraphTarget] = useState(null);
  const [countRowCount, setCountRowCount] = useState(null);
  const [countColumnCount, setCountColumnCount] = useState(null);
  const [dependentColumns, setDependentColumns] = useState(null);
  const [dependentColumns1, setDependentColumns1] = useState(null);
  const [covarianceMatrix, setCovarianceMatrix] = useState(null);
  const [covarianceMatrix1, setCovarianceMatrix1] = useState(null);

  const handleTrainDataUpload = (event) => {
    setTrainData(event.target.files[0]);
  };

  const handleTestDataUpload = (event) => {
    setTestData(event.target.files[0]);
  };

  const handleGraphUpload = () => {
    const formData = new FormData();
    formData.append('file', trainData);

    axios
      .post('/upload/graph', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setGraphUrl(response.data.graph_url);
          setGraphRowCount(response.data.rows);
          setGraphColumnCount(response.data.columns);
          setTrainData(response.data.csv_data);
          setDependentColumns(response.data.dependent_columns);
          setCovarianceMatrix(response.data.covariance_matrix);
          setGraphTarget(response.data.target)

        }
      })
      .catch((error) => {
        console.error(error);

      });
  };

  const handleCountUpload = () => {
    const formData = new FormData();
    formData.append('file', testData);

    axios
      .post('/upload/count', formData)
      .then((response) => {
        console.log(response.data);
        if (response.data.success) {
          setGraphUrl1(response.data.graph_url);
          setCountRowCount(response.data.rows);
          setCountColumnCount(response.data.columns);
          setDependentColumns1(response.data.dependent_columns);
          setCovarianceMatrix1(response.data.covariance_matrix);
        }
      })
      .catch((error) => {
        console.error(error);

      });
  };

  return (
    <div className="container">
      <div className="section">
        <h2>Train Data</h2>
        <div className="input-section">
          <input type="file" onChange={handleTrainDataUpload} />
          <button onClick={handleGraphUpload}>Upload</button>
        </div>

        {graphUrl && (
          <div className="result">
            <img src={graphUrl} alt="Graph" />
            <p>Data Rows: {graphRowCount}</p>
            <p>Data Columns: {graphColumnCount}</p>
            <p>Traget Variable : {graphTarget}</p>
            {/* {dependentColumns && (
              <>
                <p>Dependent Columns:</p>
                <ul>
                  {dependentColumns.map((column) => (
                    <li key={column}>{column}</li>
                  ))}
                </ul>
              </>
            )} */}
            {covarianceMatrix && (
              <>
                <p>Covariance Matrix:</p>
                <div className="matrix-container">
                  <table className="matrix">
                    <thead>
                      <tr>
                        <th></th> 
                        {dependentColumns.map((label) => (
                          <th key={label}>{label}</th>
                        ))}
                      </tr>
                    </thead>
                    <tbody>
                      {dependentColumns.map((rowLabel, rowIndex) => (
                        <tr key={rowIndex}>
                          <th>{rowLabel}</th> 
                          {covarianceMatrix[rowIndex].map((value, colIndex) => (
                            <td key={colIndex}>{value.toFixed(2)}</td> 
                          ))}
                        </tr>
                      ))}
                    </tbody>
                  </table>
                  <div className="lines">

                    {dependentColumns.map((_, index) => (
                      <div className="line" style={{ left: `${(index + 1) * 50}%` }} key={index}></div>
                    ))}


                    {dependentColumns.map((_, index) => (
                      <div className="line" style={{ top: `${(index + 1) * 50}%` }} key={index}></div>
                    ))}
                  </div>
                </div>
              </>
            )}
          </div>
        )}
      </div>

      <div className="section">
        <h2>Test Data</h2>

        <div className="input-section">
          <input type="file" onChange={handleTestDataUpload} />
          <button onClick={handleCountUpload}>Upload</button>
        </div>

        {countRowCount !== null && countColumnCount !== null && (
          <div className="result">
            <img src={graphUrl1} alt="Graph" />
            <p>Data Rows: {countRowCount}</p>
            <p>Data Columns: {countColumnCount}</p>
            {covarianceMatrix1 && (
              <>
                <p>Covariance Matrix:</p>
                <div className="matrix-container">
                  <table className="matrix">
                    <thead>
                      <tr>
                        <th></th> 
                        {dependentColumns1.map((label) => (
                          <th key={label}>{label}</th>
                        ))}
                      </tr>
                    </thead>
                    <tbody>
                      {dependentColumns1.map((rowLabel, rowIndex) => (
                        <tr key={rowIndex}>
                          <th>{rowLabel}</th> 
                          {covarianceMatrix1[rowIndex].map((value, colIndex) => (
                            <td key={colIndex}>{value.toFixed(2)}</td> 
                          ))}
                        </tr>
                      ))}
                    </tbody>
                  </table>
                  <div className="lines">

                    {dependentColumns1.map((_, index) => (
                      <div className="line" style={{ left: `${(index + 1) * 50}%` }} key={index}></div>
                    ))}


                    {dependentColumns1.map((_, index) => (
                      <div className="line" style={{ top: `${(index + 1) * 50}%` }} key={index}></div>
                    ))}
                  </div>
                </div>
              </>
            )}

          </div>
        )}

      </div>
    </div>
  );
}

export default ImportCSV;
